import React from 'react';
import '../styles/HomePage.css';
import FilterSidebar from '../components/FilterSidebar';
import ProductCard from '../components/ProductCard';

function HomePage() {
  // Placeholder data for products
  const products = [
    { id: 1, image: 'https://via.placeholder.com/150', title: 'Product 1', price: 29.99, stock: 0 },
    { id: 2, image: 'https://via.placeholder.com/150', title: 'Product 2', price: 39.99, stock: 10 },
    { id: 3, image: 'https://via.placeholder.com/150', title: 'Product 3', price: 19.99, stock: 5 },
    { id: 4, image: 'https://via.placeholder.com/150', title: 'Product 4', price: 49.99, stock: 8 },
  ];

  return (
    <div className="homepage">
      <header className="homepage-header">
        <h1>DISCOVER OUR PRODUCTS</h1>
        <p>Your gateway to exclusive designs and curated collections.</p>
      </header>
      <div className="main-content">
        <FilterSidebar />
        <div className="product-grid">
          {products.map(product => (
            <ProductCard key={product.id} product={product} />
          ))}
        </div>
      </div>
    </div>
  );
}

export default HomePage;
